To create your first app, you just have to create a window variable in your main function like this: // Your program will start here
public static void main(String[] args) { // Create a window with the tile 'Demo' and a size of 1280 pixels by 720 pixels Window window = new Window(1280, 720, "Demo");
} If you run your code now nothing will happen because the window won't be shown and the game loop has not been started. To change this and add some other options to the window call the show method of the window like this: public static void main(String[] args) { // Create a window with the tile 'Demo' and a size of 1280 pixels by 720 pixels Window window = new Window(1280, 720, "Demo"); // Enable vsync window.useVsync(true); // Show the window and start the game loop try { window.show(); } catch (Exception e) { e.printStackTrace(); }
} If you run your code now it still won't work because the window needs an default scene. What a scene exaclty is will be explained later. To fix it we have to create a new class which extends the Scene class. public class YOUR_SCENE_NAME extends Scene { public YOUR_SCENE_NAME(Window window) { super(window); } } Now add the class to the window like this public static void main(String[] args) { Window window = new Window(1280, 720, "Demo"); window.useVsync(true); // Set the scene window.setScene(YOU_CLASS_NAME.class); try { window.show(); } catch (Exception e) { e.printStackTrace(); }
} Finally if you run your code and everything works correctly a black window should appear on your screen. Blank window

