First you have to download the compiled jar file, or clone the repository. Then add the jar file to your projects class path, or import the cloned repository. public static void main(String[] args) { // Create a new window with a size of 1280x720 Window window = new Window(1280, 720, "Demo"); // Enable vsync window.useVsync(true); // Show the window and start the game loop try { window.show(); } catch (Exception e) { e.printStackTrace(); }
} When you run your application a window with the specified resolution should appear. Currently there will be a blank black screen. That's because we currently don't have a scene set where content could be drawn. To change that we will create a scene and add it to the window. Create a new class, it will extends the Scene class from the engine. This will be the place where your content will be drawn. package de.kostari.demo; import de.kostari.cloud.core.scene.Scene;
import de.kostari.cloud.core.window.Window; public class MainScene extends Scene { public MainScene(Window window) { super(window); } } Now you just have to add it to the window at your window variable. window.setScene(YOUR_CLASS_NAME.class); When you start your application now nothing seems to be changed, but now we can draw content to the window. In your scene class add a draw method and draw a rectangle to the screen using the Render utility class. @Override
public void draw(float delta) { Render.rect(window.getHalfSize(), 100, 100, CColor.WHITE); super.draw(delta);
} If everything worked and you did everything correctly you should see a white rectangle in the center of your window. If you want to learn more go head to the wiki here .
